let class_ = "nav-link",
variant = "outline-light"

export const NavTopics = [ 
    {
        path: '/',
        label: <img src="https://uat.gofrugal.com/blog/wp-content/uploads/6-4-1-1.jpg" alt="https://gdurl.com/hIGa" height='60'/>,
        class: "navbar-item",
        variant: "nav-link"
    },
    {
        path: '/Customer', 
        label: 'Customer', 
        class: class_, 
        variant: variant
    },
    {
        path: '/Order', 
        label: "Order", 
        class: class_, 
        variant: variant
    },
    {
        path: '/Resources', 
        label: 'Resources', 
        class: class_, 
        variant: variant
    },
    {
        path:'/Employee',
        label: 'Employee',
        class: class_,
        variant: variant
    },
    {
        path:'/Reservation',
        label: 'Reservations',
        class: class_,
        variant: variant
    }

]

